const EventPractice = () => {
    const[form,setForm] = useState({
        username:'',
        message:''
    });

    const {username,message} = form;
    const onChange = e => {
        const nextForm ={
            ...form, [e.target.name]:e.target.value
        };
        setForm()
    }
}
